const a={a1:"仅支持移动端",a2:"手势包括<strong>触摸方法</strong>（手指在屏幕上做什么）和<strong>触摸动作</strong>（特定手势引发的结果）。",a3:"<strong>触摸方法</strong>根据所处情境不同可能导致不同的结果。例如，<strong>长按</strong>可以选择像列表项之类的元素。",a4:"<strong>触摸动作</strong>可以通过组合多个触摸方法来实现。例如，用户可以使用捏放、双击或双击拖拽等触摸方法，来放大视图。",a5:"拖拽、滑动和甩动的类型",a6:"滚动<br />滚动时显示<br />平移<br />忽略<br />滑动刷新<br />边缘滑动<br />翻页滑动<br />滚动折叠<br />菜单打开<br />倾斜",a7:"触摸机制",a8:"触摸活动",a9:"拖拽、滑动和甩动细节",a10:"触摸机制指的是用户的手指在屏幕上做了什么。",a11:"触摸",a12:"单指按下，然后抬起",a13:"示例：选择",a14:"触摸两下",a15:"单指按下，然后抬起，然后再按下，再抬起",a16:"示例：放大",a17:"拖拽、滑动或甩动",a18:"单指按下，然后移动，然后抬起",a19:"示例：忽略、滚动、快速滚动等",a20:"长按",a21:"单指按下，等待片刻，然后抬起",a22:"示例：选择一个元素，比如一个列表项",a23:"长按不能用于显示上下文菜单。",a24:"长按并拖拽",a25:"单指按下，等待片刻后移动手指，然后抬起",a26:"示例：选取并移动，选择多个项目",a27:"触摸两下并拖拽",a28:"单指按下，然后抬起，然后再单指按下，然后移动，然后抬起",a29:"示例：放大、缩小",a30:"双指张开",a31:"双指按下，然后将手指分开，然后抬起",a32:"示例：放大",a33:"双指捏合",a34:"双指按下，然后并拢，然后抬起",a35:"示例：缩小",a36:"双指触摸",a37:"双指按下，然后抬起",a38:"示例：缩小",a39:"双指滑动、拖拽、甩动",a40:"双指按下、然后移动，然后抬起",a41:"示例：选择多个项目，然后平移，倾斜",a42:"双指长按",a43:"双指按下，等待片刻后抬起",a44:"示例：无；这个手势不常用",a45:"双指长按并拖拽",a46:"双指按下，等待片刻，然后移动，然后抬起",a47:"示例：选取并移动",a48:"双指触摸两下",a49:"双指按下，然后抬起，然后再按下，再抬起",a50:"示例：缩小",a51:"旋转",a52:"双指按下，同时绕中心点旋转，然后抬起",a53:"示例：旋转内容，比如地图",a54:"特定情境中的特定手势及其结果。",a55:"操作",a56:"说明",a57:"触摸机制",a58:"激活",a59:"激活界面中的元素，比如按钮",a60:"触摸",a61:"取消或离开",a62:"取消或离开当前任务，例如对话框或菜单",a63:"触摸",a64:"启用/禁用灯光",a65:"隐藏/显示视图中的操作栏",a66:"触摸",a67:"拖拽、滑动或甩动",a68:"参见下文的<strong>拖拽、滑动或甩动细节</strong>来了解滚动、滚动显示、平移、忽略、滑动刷新、边缘滑动、翻页滑动、滚动折叠、菜单打开以及倾斜之间的区别。",a69:"拖拽、滑动或甩动",a70:"数据选择（没有选中项时）",a71:"选择一个元素",a72:"长按，双指触摸",a73:"数据选择（有选中项时）",a74:"在编辑模式下选择更多元素<br /><br />可以和随后的单指或双指手势进行任意组合",a75:"触摸，双指触摸",a76:"数据多选拖拽",a77:"从手势触摸点开始显示选择框<br />宽度和高度可以根据手指的位置进行调整。<br />最终的选择项取决于手指抬起时选择框的范围。",a78:"双指滑动或拖拽，长按并拖拽（无选中项时）",a79:"选取并移动",a80:"作用于已选中的项目。可以用来：",a81:"重新布局视图内的数据",a82:"将项目放到容器或目标上",a83:"调整列表或卡片集中的项目顺序",a84:"双指长按，在已选中项目上长按并拖拽",a85:"放大",a86:"放大内容",a87:"触摸两下",a88:"触摸两下并拖拽（向下）",a89:"双指张开",a90:"放大到合适大小",a91:"对于嵌套的视图，放大可访问的最小视图",a92:"触摸两下",a93:"缩小",a94:"缩小内容",a95:"在最大视图时触摸两下",a96:"触摸两下并拖拽（向上）",a97:"双指捏合",a98:"双指触摸",a99:"双指触摸两下",a100:"展开",a101:"展开收起的内容",a102:"双指张开",a103:"收缩",a104:"收起展开的内容",a105:"双指捏合",a106:"旋转",a107:"旋转目标内容",a108:"旋转",a109:"滑动手势的功能因情境而异。手指移动的速度是拖拽、滑动和甩动之间最大的区别。",a110:"<strong>拖拽</strong>：细致的手势、移动缓慢，但更有掌控感，通常有一个屏幕中的目标元素",a111:"<strong>滑动</strong>：粗略的手势、移动快速，通常没有屏幕中的目标元素",a112:"<strong>甩动</strong>：粗略的手势，没有屏幕中的目标元素",a113:"手势速度会影响操作是否可立即撤销。",a114:"滑动是否变成甩动，取决于结束速度、以及受影响的元素是否已经越过阈值（或超过了可以撤销操作的点）",a115:"拖拽操作会在移动期间和目标元素保持联系，所以反转手势方向，会把元素拖拽回临界点",a116:"甩动的速度更快，且会在元素越过临界点时与元素断开联系，防止操作被撤销",a117:"滚动",a118:"<strong>滚动</strong>是对内容主题在水平或垂直方向上的滑动。",a119:"用法",a120:"滚动的量取决于手势的速度：拖拽（慢） vs. 甩动（快）。",a121:"内容滚动的速度应该和手势速度保持一致。内容应该要有 “黏到” 手指或触摸设备上的感觉。",a122:"滚动方向示例",a123:"滚动时显示",a124:"<strong>滚动时显示</strong>意味着在内容区域内反向滚动会显示应用内的隐藏元素。例如，在 Chrome 中向上滚动会出现地址栏。要隐藏这些元素，恢复原来的滚动方向即可。",a125:"滚动方向示例",a126:"平移",a127:"<strong>平移</strong>是全方向的单指或双指手势，用来扩展视野。拖拽通常和平移同时使用。使用甩动时，内容会沿着甩动的方向以甩动的速度平移。",a128:"平移适用于：",a129:"没有边界的内容（地图）",a130:"内容的尺寸超出了屏幕的宽度或高度（放大网页或图片时）",a131:"<strong>双指平移</strong>是从另一个双指手势过渡过来的（例如：双指缩放或旋转），例如在地图中。如果手势是以双指平移开始的，那么它就会导致<strong>倾斜</strong>。",a132:"平移示例",a133:"忽略",a134:"<strong>忽略</strong>手势源自可滑动的元素，例如列表项或卡片，忽略方向和滚动方向垂直。",a135:"手势通常是水平的。",a136:"只有越过临界点后忽略操作才会被执行。",a137:"忽略手势示例",a138:"滑动刷新",a139:"<strong>滑动刷新</strong>通常发生在一个垂直向下的拖拽中。通常在列表的顶部、卡片或其他容器的边缘（新内容的表面）起作用。",a140:"滑动刷新手势示例",a141:"边缘滑动",a142:"<strong>边缘滑动</strong>手势从屏幕外侧开始，用于显示屏幕外的内容。边缘滑动会调用独立于当前视图的内容。",a143:"如果没有定义边缘滑动手势，边缘滑动默认为<strong>翻页滑动</strong>。",a144:"只有越过临界点后边缘滑动才会被执行。",a145:"边缘滑动示例",a146:"翻页滑动",a147:"<strong>翻页滑动</strong>是在屏幕上，内容内部的滑动，用于显示屏幕之外的内容。每次翻页滑动都会切换一个页面、或一个选项卡。",a148:"如果页面内容缩放比例超过 >100%，在内容内部滑动会<strong>平移</strong>到内容的边缘，到边缘后继续滑动就会<strong>翻页</strong>。",a149:"滑动翻页只有越过临界点后才会执行。",a150:"当页面内有个别元素可滑动时，不要使用滑动翻页手势。",a151:"参考下文：滚动折叠",a152:"滑动翻页示例",a153:"滚动折叠",a154:"<strong>滚动折叠</strong>通过在滚动的内容顶部或底部使用滑动翻页，来回到内容结构的上一级。",a155:"滚动折叠手势只有在越过临界点后才会执行。",a156:"滚动折叠示例",a157:"菜单打开",a158:"在菜单或选择器上拖拽会出现菜单。手指抬起后，高亮的菜单项会被选中。",a159:"菜单也可以通过触摸打开。",a160:"拖拽也可以用于<strong>菜单打开</strong>。",a161:"菜单打开拖拽示例",a162:"倾斜",a163:"<strong>倾斜</strong>会使 3D 内容向前或向后转动。",a164:"如果从另一个双指手势（如捏合或旋转）过渡而来，例如在地图中，会导致出现<strong>双指平移</strong>。",a165:"拖拽也可以用于<strong>倾斜</strong>。",a166:"倾斜示例",a167:"Material Design 中的手势与触摸方法和动作有关",a168:"Material Design 中的单指触摸手势",a169:"Material Design 中的双击手势",a170:"Material Design 中的拖拽和滑动手势",a171:"Material Design 中的长按手势",a172:"Material Design 中的长按并拖拽手势",a173:"Material Design 中的双击并拖拽手势",a174:"Material Design 中的双指张开手势",a175:"Material Design 中的双指捏合手势",a176:"Material Design 中的双指触摸手势",a177:"Material Design 中的双指滑动、拖拽手势",a178:"Material Design 中的双指长按手势",a179:"Material Design 中的双指长按并拖拽手势",a180:"Material Design 中的双指触摸两下手势",a181:"Material Design 中的旋转手势",a182:"Material Design 的滚动方向示例",a183:"Material Design 的滚动方向示例",a184:"Material Design 中的平移示例",a185:"Material Design 中的忽略手势示例",a186:"Material Design 中的滑动刷新手势示例",a187:"Material Design 中的边缘滑动示例",a188:"Material Design 中的滑动翻页示例",a189:"Material Design 中的滚动折叠示例",a190:"Material Design 中的菜单拖拽示例",a191:"Material Design 中的倾斜示例图"};export{a as zhCn};
